Unity is a game development tool that has been designed to let you focus on creating amazing games.

Explore the whimsical world of Mothhead, a new interactive art demo built in Unity by the artists at industry art studio Massive Black. Mothhead demonstrates not only Unity's graphics and rendering power, but its efficiency: a prototype was up and running in just a few hours with Unity, compared to the months the artists used, with little success, on working with another engine.





